//SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

contract Storage {
    mapping(address => uint256) private whitelist_addr;

    // whitelist 작성
    constructor() {
        address a = 0xb2f8c60b26a53Ae960536333311CB4a04f519084;
        whitelist_addr[a] = 1;
    }

    function _is_whitelist(address addr) internal virtual returns(bool){
        if (whitelist_addr[addr] == 1)
        {
            return true;
        }
        else
        {
            return false;
        }
    }

    function is_whitelist_2() public view returns(bool){
        if (whitelist_addr[msg.sender] == 1)
        {
            return true;
        }
        else
        {
            return false;
        }
    }
}

